import "./App.css";
import ProductList from "./components/ProductList";

import products from "./assets/products";

import { useCart } from "./Providers/Cart";

function App() {
  const { cart } = useCart();

  return (
    <div>
      <ProductList list={products} variant={false} />
      <ProductList list={cart} variant={true} />
    </div>
  );
}

export default App;
